import REturnArroW from './Arrow';
import ReturnTitle from './Title';
import REturnLogo from './Logo';
import REturnQuOte from './Quote';
import ReturnValues from './Values';


// Transaction view available
export default function ReturnValiDExchange() {
 return (
  <div className='wrp-exchange-money'>
   <REturnArroW />
   <ReturnTitle />
   <REturnLogo />
   <REturnQuOte />
   <ReturnValues />
  </div>
 );
};
